import React from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import logo from './logo.svg';
import './App.css';
import './form'



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Link to="/page2"><button>
              Go to Page 2 
            </button>
            </Link>
      </header>
    </div>
  );
}

export default App;
